// NexusLexerInit initializes any static state used to implement NexusLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewNexusLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func NexusLexerInit() {
	staticData := &NexusLexerLexerStaticData
	staticData.once.Do(nexuslexerLexerInit)
}

// NewNexusLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewNexusLexer(input antlr.CharStream) *NexusLexer {
	NexusLexerInit()
	l := new(NexusLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &NexusLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "Nexus.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

